const r5Test44: fhir5.ArtifactAssessment = {"resourceType":"ArtifactAssessment","id":"example-certainty-rating","identifier":[{"type":{"text":"FEvIR Object Identifier"},"system":"https://fevir.net","value":"27756","assigner":{"display":"Computable Publishing LLC"}}],"date":"2021-11-02T14:48:59.890Z","copyright":"https://creativecommons.org/licenses/by-nc-sa/4.0/","artifactReference":{"reference":"Evidence/18812","type":"Evidence","display":"Critically appraised summary of all-cause mortality in meta-analysis of RCTs of heparin for moderately ill patients with COVID-19"},"content":[{"informationType":"rating","summary":"serious concerns with risk of bias, inconsistency, and imprecision","type":{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/certainty-type","code":"Overall","display":"Overall certainty"}]},"classifier":[{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/certainty-rating","code":"very-low","display":"Very low quality"}]}],"author":{"display":"Brian S. Alper"},"freeToShare":true,"component":[{"informationType":"rating","summary":"risk of bias in both included trials","type":{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/certainty-type","code":"RiskOfBias","display":"Risk of bias"}]},"classifier":[{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/certainty-rating","code":"serious-concern","display":"serious concern"}]}],"author":{"display":"Brian S. Alper"}},{"informationType":"rating","summary":"high degree of heterogeneity (I-squared 80.7%) with confidence intervals of 2 trial effect estimates barely overlapping","type":{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/certainty-type","code":"Inconsistency","display":"Inconsistency"}]},"classifier":[{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/certainty-rating","code":"serious-concern","display":"serious concern"}]}],"author":{"display":"Brian S. Alper"}},{"informationType":"rating","type":{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/certainty-type","code":"Indirectness","display":"Indirectness"}]},"classifier":[{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/certainty-rating","code":"no-concern","display":"no serious concern"}]}],"author":{"display":"Brian S. Alper"}},{"informationType":"rating","summary":"95% confidence interval includes both large effects and no effects","type":{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/certainty-type","code":"Imprecision","display":"Imprecision"}]},"classifier":[{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/certainty-rating","code":"serious-concern","display":"serious concern"}]}],"author":{"display":"Brian S. Alper"}},{"informationType":"rating","type":{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/certainty-type","code":"PublicationBias","display":"Publication bias"}]},"classifier":[{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/certainty-rating","code":"no-concern","display":"no serious concern"}]}],"author":{"display":"Brian S. Alper"}}]}],"meta":{"tag":[{"system":"http://terminology.hl7.org/CodeSystem/v3-ActReason","code":"HTEST","display":"test health data"}]}};

// artifactassessment-risk-of-bias-example.json
const r5Test46: fhir5.ArtifactAssessment = {"resourceType":"ArtifactAssessment","id":"risk-of-bias-example","identifier":[{"type":{"text":"FEvIR Object Identifier"},"system":"https://fevir.net","value":"27751","assigner":{"display":"Computable Publishing LLC"}}],"date":"2021-11-02T14:31:30.239Z","copyright":"https://creativecommons.org/licenses/by-nc-sa/4.0/","lastReviewDate":"2021-08-11","artifactCanonical":"http://fevir.net/resources/Evidence/7637","content":[{"informationType":"rating","type":{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/certainty-type","version":"5.0.0-snapshot1","code":"RiskOfBias","display":"Risk of bias","userSelected":true}]},"classifier":[{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/certainty-rating","version":"5.0.0-snapshot1","code":"extremely-serious-concern","display":"extremely serious concern","userSelected":true}]}],"author":{"display":"COVID-19 Knowledge Accelerator Evidence 7637 Authors (Brian S. Alper, Harold Lehmann, Ahmad Sofi-Mahmudi, Joanne Dehnbostel, Ilkka Kunnamo)"},"freeToShare":true,"component":[{"summary":"Inclusion of suspected COVID-19 in 1 of 3 trials may introduce selection bias, but the impact appears limited.","type":{"text":"Selection Bias"},"classifier":[{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/certainty-rating","version":"5.0.0-snapshot1","code":"no-concern","display":"no serious concern","userSelected":true}]}],"author":{"display":"Brian S. Alper, Joanne Dehnbostel, Muhammad Afzal"},"component":[{"summary":"Definition of Selection Bias = A bias resulting from methods used to select subjects or data, factors that influence initial study participation, or differences between the study sample and the population of interest"}]},{"summary":"The study design used response-adaptive randomization in which group assignment ratios could be modified during the trial on the basis of response-adaptive interim analyses to favor the assignment of patients to the treatment group showing greater benefit. The confounding by time (imbalanced randomization with time period) is not adequately reported to determine the potential influence on results or adequacy of adjusted analyses.","type":{"text":"Confounding Covariate Bias"},"classifier":[{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/certainty-rating","version":"5.0.0-snapshot1","code":"serious-concern","display":"serious concern","userSelected":true}]}],"author":{"display":"Brian S. Alper, Ilkka Kunnamo, Alfonso Iorio, Joanne Dehnbostel, Harold Lehmann, Kenneth Wilkins; clarifying explanation reviewed by Janice Tufte"},"component":[{"summary":"Definition of Confounding Covariate Bias = A situation in which the effect or association between an exposure and outcome is distorted by another variable. For confounding covariate bias to occur the distorting variable must be (1) associated with the exposure and the outcome, (2) not in the causal pathway between exposure and outcome, and (3) unequally distributed between the groups being compared."},{"summary":"ATTACC implemented response-adaptive randomization on December 15, 2020, which led to imbalanced randomization. No data reported to determine if intervention-specific outcome rates were similar or different before and after December 15, 2020 in the ATTACC cohort."},{"summary":"Insufficient details reported to judge whether there is an imbalance in outcomes related to the adaptive randomization which in turn could be used to judge the validity of adjustment methods in the statistical model for this concern and the appropriateness of any sensitivity analyses."},{"summary":"Response-adaptive randomization led to imbalanced randomization.","type":{"text":"Allocation Bias"},"classifier":[{"text":"Adaptive randomization is not a concern by itself, only if it results in a confounding difference."}],"author":{"display":"Brian S. Alper, Joanne Dehnbostel, Harold Lehmann, Kenneth Wilkins"},"component":[{"summary":"Definition of Allocation Bias = A confounding covariate bias resulting from methods for assignment of the independent variable by the investigator to evaluate a response or outcome."},{"summary":"ATTACC implemented response-adaptive randomization on December 15, 2020, which led to imbalanced randomization."}]},{"summary":"There is an unequal distribution of calendar time between the groups being compared.","type":{"text":"Confounding difference"},"classifier":[{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/certainty-rating","version":"5.0.0-snapshot1","code":"serious-concern","display":"serious concern","userSelected":true}]}],"author":{"display":"Brian S. Alper, Joanne Dehnbostel, Harold Lehmann, Kenneth Wilkins"},"component":[{"summary":"Definition of Confounding difference = A confounding covariate bias in which the unequal distribution of a potentially distorting variable is recognized."},{"summary":"Incomplete reporting limits the determination of the potential degree of influence of calendar time."},{"summary":"There is evidence of potential for calendar time to influence the results: In an observational study of 18,508 adults with laboratory-confirmed, COVID-19 associated hospitalization 'The percentage of hospitalized patients admitted to the ICU decreased from 37.8% in March to 20.5% in December' (Ann Intern Med 2021 Aug 10 https://www.acpjournals.org/doi/10.7326/M21-1991)."}]}]},{"summary":"Awareness of treatment assignment may reduce clinical decision to initiate some types of \"organ support\" in patients with higher risk of major bleeding.","type":{"text":"Performance Bias"},"classifier":[{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/certainty-rating","version":"5.0.0-snapshot1","code":"very-serious-concern","display":"very serious concern","userSelected":true}]}],"author":{"display":"Brian S. Alper, Joanne Dehnbostel, Harold Lehmann, Muhammad Afzal"},"component":[{"summary":"Definition of Performance Bias = A bias resulting from differences between the received exposure and the intended exposure."},{"summary":"Lack of blinding may explain reported differences in the primary outcome.","type":{"text":"Inadequate blinding of intervention deliverers"},"classifier":[{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/certainty-rating","version":"5.0.0-snapshot1","code":"very-serious-concern","display":"very serious concern","userSelected":true}]}],"author":{"display":"Brian S. Alper; clarifying explanation reviewed by Janice Tufte"},"component":[{"summary":"The absolute difference in survival without intubation was 1%, so 3% of the 4% absolute difference in the primary outcome can be considered \"organ support without intubation\"."},{"summary":"The specific \"organ support without intubation\" was not reported. The methods for one of the included trials stated \"Organ Support is defined as receipt of invasive or non-invasive mechanical ventilation, high flow nasal oxygen, vasopressor therapy, or ECMO support\""},{"summary":"Awareness of treatment assignment may reduce clinical decision to initiate \"organ support without intubation\" in patients with higher risk of major bleeding."},{"summary":"Definition of Inadequate blinding of intervention deliverers = A performance bias due to awareness of the allocated intervention by individuals providing or delivering the intervention."}]},{"summary":"Crossover to other intervention in 20%","type":{"text":"Deviation from study intervention protocol"},"classifier":[{"text":"degree of concern unclear"}],"author":{"display":"Surbhi Shah, Brian S. Alper"},"component":[{"summary":"Therapeutic dose anticoagulation (in the first 24-48 hours following randomization) was reported in 79.6% of the therapeutic arm and 0.9% of the usual care arm. (Table S3)"},{"summary":"Definition of Deviation from study intervention protocol = A performance bias in which the intervention received differs from the intervention specified in the study protocol."}]},{"summary":"We discussed whether they may be a bias related to limited adherence to anticoagulation. Because this was an inpatient population, we did not expect adherence problems that are more common with outpatient thromboprophylaxis.","type":{"text":"Nonadherence of implementation"},"classifier":[{"text":"limited concern"}],"author":{"display":"COVID-19 Knowledge Accelerator Working Group discussion with Brian S. Alper, Ilkka Kunnamo, Joanne Dehnbostel; Performance Bias concern initially suggested by Harold Lehmann"},"component":[{"summary":"Initial adherence to the protocol-assigned anticoagulation dose after randomization was 88.3% in the therapeutic-dose anticoagulation group and 98.3% in the thromboprophylaxis group (Table S3)."},{"summary":"Definition of Nonadherence of implementation = A performance bias in which the intervention deliverers do not completely adhere to the expected intervention."}]}]},{"summary":"The influence of awareness of treatment assignment by the treating clinicians on the initaition of organ support (which is the primary outcome) was already addressed as Performance Bias so is not repeated here as a bias in detecting the outcome.","type":{"text":"Detection Bias"},"classifier":[{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/certainty-rating","version":"5.0.0-snapshot1","code":"no-concern","display":"no serious concern","userSelected":true}]}],"author":{"display":"Brian S. Alper, Joanne Dehnbostel, Muhammad Afzal"},"component":[{"summary":"Definition of Detection Bias = A bias due to distortions in how variable values (data) are determined."}]},{"summary":"Only 19 of 1190 (1.6%) therapeutic group and 6 of 1054 (0.6) prophylactic group were excluded after randomization.","type":{"text":"Attrition Bias"},"classifier":[{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/certainty-rating","version":"5.0.0-snapshot1","code":"no-concern","display":"no serious concern","userSelected":true}]}],"author":{"display":"Brian S. Alper, Joanne Dehnbostel, Muhammad Afzal"},"component":[{"summary":"Definition of Attrition Bias = A bias due to absence of expected participation or data collection after selection for study inclusion."}]},{"summary":"It is unknown if the results are sensitive to the analytic method, and the stopping criteria were based on statistical significance and not magnitude of effect.","type":{"text":"Analysis Bias"},"classifier":[{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/certainty-rating","version":"5.0.0-snapshot1","code":"very-serious-concern","display":"very serious concern","userSelected":true}]}],"author":{"display":"Brian S. Alper, Joanne Dehnbostel, Muhammad Afzal, Janice Tufte"},"component":[{"summary":"Definition of Analysis Bias = A bias related to the analytic process applied to the data."},{"summary":"A frequentist analysis is not reported so we cannot determine if the results are sensitive to the analytic method","type":{"text":"Bias related to selection of the analysis"},"classifier":[{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/certainty-rating","version":"5.0.0-snapshot1","code":"very-serious-concern","display":"very serious concern","userSelected":true}]}],"author":{"display":"Brian S. Alper, Joanne Dehnbostel, Muhammad Afzal, Janice Tufte"},"component":[{"summary":"Definition of Bias related to selection of the analysis = An analysis bias due to inappropriate choice of analysis methods before the analysis is applied."},{"summary":"There was no pre-specified frequentist analysis. There was no posthoc frequentist analysis reported."},{"summary":"It is uncertain what a frequentist analysis would show and uncertain whether the choice of Bayesian analysis or frequentist analysis has a substantial influence on the results."}]},{"summary":"The stopping criteria were based on statistical significance and not magnitude of effect.","type":{"text":"Early trial termination"},"classifier":[{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/certainty-rating","version":"5.0.0-snapshot1","code":"very-serious-concern","display":"very serious concern","userSelected":true}]}],"author":{"display":"Brian S. Alper, Joanne Dehnbostel, Muhammad Afzal, Janice Tufte"},"component":[{"summary":"There was no “minimally important difference”. So a 99% probability of having an odds ratio > 1 (even if the magnitude of effect is infinitesimal) was used to decide it was time to stop the trial."}]}]}]},{"informationType":"comment","summary":"Results not consistent with critically ill cohort.","type":{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/certainty-type","version":"5.0.0-snapshot1","code":"Inconsistency","display":"Inconsistency","userSelected":true}]},"author":{"display":"Ilkka Kunnamo"}}],"meta":{"tag":[{"system":"http://terminology.hl7.org/CodeSystem/v3-ActReason","code":"HTEST","display":"test health data"}]}};

