const r5Test159: fhir5.Citation = {"resourceType":"Citation","id":"citation-example-research-doi","identifier":[{"type":{"text":"FEvIR Object Identifier"},"system":"https://fevir.net","value":"60","assigner":{"display":"Computable Publishing LLC"}}],"title":"NInFEA Citation","status":"active","date":"2021-09-24T10:41:01.740Z","publisher":"Computable Publishing LLC","contact":[{"telecom":[{"system":"email","value":"support@computablepublishing.com"}]}],"description":"A citation of a dataset","copyright":"https://creativecommons.org/licenses/by-nc-sa/4.0/","summary":[{"style":{"text":"as reported on PhysioNet"},"text":"Pani, D., Sulas, E., Urru, M., Sameni, R., Raffo, L., & Tumbarello, R. (2020). NInFEA: Non-Invasive Multimodal Foetal ECG-Doppler Dataset for Antenatal Cardiology Research (version 1.0.0). PhysioNet. https://doi.org/10.13026/c4n5-3b04."},{"style":{"coding":[{"system":"http://terminology.hl7.org/ValueSet/citation-summary-style","code":"comppub","display":"Computable Publishing"}]},"text":"NInFEA: Non-Invasive Multimodal Foetal ECG-Doppler Dataset for Antenatal Cardiology Research [Dataset], version 1.0.0. Contributors: Danilo Pani, Eleonora Sulas, Monica Urru, Reza Sameni, Luigi Raffo, Roberto Tumbarello. In: PhysioNet, DOI 10.13026/c4n5-3b04. Published November 12, 2020. Accessed March 17, 2021. Available at: https://physionet.org/content/ninfea/1.0.0/."}],"citedArtifact":{"identifier":[{"system":"https://doi.org","value":"10.13026/c4n5-3b04"}],"relatedIdentifier":[{"system":"https://doi.org","value":"10.1038/s41597-021-00811-3"}],"dateAccessed":"2021-03-17","version":{"value":"1.0.0"},"title":[{"type":[{"text":"primary-human-use"}],"language":{"coding":[{"system":"urn:ietf:bcp:47","version":"4.0.1","code":"en","display":"English"}]},"text":"NInFEA: Non-Invasive Multimodal Foetal ECG-Doppler Dataset for Antenatal Cardiology Research"}],"abstract":[{"type":{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/cited-artifact-abstract-type","code":"primary-human-use","display":"Primary human use"}]},"language":{"coding":[{"system":"urn:ietf:bcp:47","code":"en","display":"English"}]},"text":"The development of algorithms for the extraction of the foetal ECG (fECG) from non-invasive recordings is hampered by the lack of publicly-available reference datasets, which could be used to benchmark different algorithms while providing a ground truth on the foetal heart activity when an invasive scalp lead is unavailable. By enriching the electrophysiological recordings with simultaneous multimodal signals, these datasets could also help the investigation of the foetal cardiac physiology, providing ground truth for the analysis in early pregnancy, when the fECG is not directly accessible.  The Non-Invasive Multimodal Foetal ECG-Doppler Dataset for Antenatal Cardiology Research (NInFEA) is the first open-access dataset featuring simultaneous non-invasive electrophysiological recordings, fetal pulsed-wave Doppler (PWD) and maternal respiration signals. The dataset includes 60 entries from 39 voluntary pregnant women, between the 21st and the 27th week of gestation. Every entry is composed of 27 electrophysiological channels (2048 Hz, 22 bits, acquired by means of the TMSi Porti7 system), maternal respiration signal (through a resistive thoracic belt), synchronised foetal trans-abdominal PWD and clinical annotations provided by expert clinicians at the time of the signal collection."}],"relatesTo":[{"type":"derived-from","classifier":[{"text":"original publication"}],"citation":"Sulas, E., Urru, M., Tumbarello, R., Raffo, L., Sameni, R., Pani, D., A non-invasive multimodal foetal ECG–Doppler dataset for antenatal cardiology research. Sci Data 8, 30 (2021). https://doi.org/10.1038/s41597-021-00811-3","document":{"url":"https://doi.org/10.1038/s41597-021-00811-3"}},{"type":"depends-on","classifier":[{"text":"ontology"}],"display":"Experimental Factor Ontology","document":{"url":"http://data.bioontology.org/ontologies/EFO"}}],"publicationForm":[{"publishedIn":{"type":{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/published-in-type","version":"5.0.0-snapshot1","code":"D019991","display":"Database"}]},"title":"PhysioNet","publisher":{"display":"MIT Laboratory for Computational Physiology"}},"articleDate":"2020-11-12","language":[{"coding":[{"system":"urn:ietf:bcp:47","version":"4.0.1","code":"en","display":"English"}]}],"copyright":"https://physionet.org/content/ninfea/view-license/1.0.0/ and https://physionet.org/content/ninfea/1.0.0/LICENSE.txt"}],"webLocation":[{"classifier":[{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/artifact-url-classifier","version":"5.0.0-snapshot1","code":"webpage","display":"Webpage"}]}],"url":"https://physionet.org/content/ninfea/1.0.0/"},{"classifier":[{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/artifact-url-classifier","version":"5.0.0-snapshot1","code":"doi-based","display":"DOI Based"}]}],"url":"https://doi.org/10.13026/c4n5-3b04"},{"classifier":[{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/artifact-url-classifier","version":"5.0.0-snapshot1","code":"doi-based","display":"DOI Based"}],"text":"original publication"}],"url":"https://doi.org/10.1038/s41597-021-00811-3"},{"classifier":[{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/artifact-url-classifier","version":"5.0.0-snapshot1","code":"compressed-file","display":"Compressed file"}]}],"url":"https://physionet.org/static/published-projects/ninfea/ninfea-non-invasive-multimodal-foetal-ecg-doppler-dataset-for-antenatal-cardiology-research-1.0.0.zip"},{"classifier":[{"text":"DOI-for-metadata"}],"url":"https://doi.org/10.6084/m9.figshare.13283492"}],"classification":[{"classifier":[{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/cited-artifact-classification-type","code":"knowledge-artifact-type","display":"Knowledge Artifact Type"}]},{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/citation-artifact-classifier","version":"5.0.0-snapshot1","code":"D064886","display":"Dataset"}]}]},{"type":{"text":"topic"},"classifier":[{"coding":[{"system":"http://www.ebi.ac.uk/efo","code":"EFO_0004327","display":"electrocardiography"}],"text":"ecg"}]},{"type":{"text":"topic"},"classifier":[{"coding":[{"system":"http://purl.obolibrary.org/obo","code":"FMA_63919","display":"foetus"}],"text":"foetus"}]},{"type":{"text":"topic"},"classifier":[{"text":"pwd"}]},{"type":{"text":"topic"},"classifier":[{"text":"doppler"}]},{"type":{"text":"topic"},"classifier":[{"text":"foetal ecg"}]},{"type":{"text":"topic"},"classifier":[{"text":"maternal ecg"}]},{"type":{"text":"topic"},"classifier":[{"text":"pwd envelope"}]},{"type":{"text":"topic"},"classifier":[{"text":"non-invasive"}]},{"type":{"text":"topic"},"classifier":[{"coding":[{"system":"http://snomed.info/sct","code":"394579002","display":"Cardiology (qualifier value)"}],"text":"cardiology"}]},{"type":{"text":"topic"},"classifier":[{"coding":[{"system":"http://snomed.info/sct","code":"314204000","display":"Early stage of pregnancy (finding)"}],"text":"early pregnancy"}]},{"type":{"text":"topic"},"classifier":[{"text":"antenatal"}]},{"type":{"text":"topic"},"classifier":[{"coding":[{"system":"http://snomed.info/sct","code":"75444003","display":"Fetal electrocardiogram (procedure)"}],"text":"fecg"}]},{"type":{"text":"subject type"},"classifier":[{"coding":[{"system":"http://purl.bioontology.org/ontology/NCBITAXON","code":"9606","display":"Homo sapiens"}]}]},{"type":{"text":"use context"},"classifier":[{"coding":[{"system":"http://www.ebi.ac.uk/efo","code":"EFO_0005112","display":"gestational age"}]}]},{"type":{"text":"use context"},"classifier":[{"coding":[{"system":"http://www.ebi.ac.uk/efo","code":"EFO_0004327","display":"electrocardiography"}]}]},{"type":{"text":"use context"},"classifier":[{"coding":[{"system":"http://purl.obolibrary.org/obo","code":"VT_2000017","display":"heart electrical impulse conduction trait"}]}]}],"contributorship":{"summary":[{"type":{"coding":[{"system":"http://terminology.hl7.org/CodeSystem/contributor-summary-type","version":"5.0.0-snapshot1","code":"author-string","display":"Author string"}]},"source":{"text":"copied-from-article"},"value":"Danilo Pani, Eleonora Sulas, Monica Urru, Reza Sameni, Luigi Raffo, Roberto Tumbarello"},{"type":{"text":"acknowledgements"},"source":{"text":"copied-from-article"},"value":"The authors wish to thank the Pediatric Cardiology and Congenital Heart Disease Unit, Brotzu Hospital (Cagliari, Italy), where the dataset was collected, and all the voluntary pregnant women for their kindness in giving their signals for this research. The authors gratefully thank Alessandra Cadoni, Graziella Secchi, Luisa Aru, Elisa Farris, Chiara Fenu, Elisa Gusai, Giulia Baldazzi, Giulia Pili for their support in the recording of the signals included in this dataset.  Part of this research was supported by the Italian Government—Progetti di InteresseNazionale (PRIN) under the grant agreement 2017RR5EW3 - ICT4MOMs project.  Eleonora Sulas is grateful to Sardinia Regional Government for supporting her PhD scholarship (P.O.R.F.S.E., European Social Fund 2014-2020).  Reza Sameni acknowledges the funding from the European Research Council Advanced Grant Number 320684, on Challenges in the Extraction and Separation of Sources (CHESS) for his contribution in this research, provided during his appointment at GIPSA-lab, Grenoble Alpes University, Grenoble, France."}]}},"meta":{"tag":[{"system":"http://terminology.hl7.org/CodeSystem/v3-ActReason","code":"HTEST","display":"test health data"}]}};

